import React from 'react';
import logo from './images/logo.svg';

function Nav() {
    return (
        <>
            <nav className="nav">
                <ul>
                    <img src={logo} />
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                </ul>
            </nav>
        </>
    );
}

export default Nav;
